#神仙答案
#说明： j 表示子串终止位置，i表示字串起始位置 当未出现重复时，字符串的长度即为字符串的结束位置减去起始位置。发生重复时，重新利用字符串的结束位置j减去新的起始位置i，并与之前的未重复字串的长度作比较取较大者
#  新的起始位置i=max(st[s[j]], i)，即重复字符的位置如果在原起始位置前面，则新起始位置不用动；如果在原起始位置的后面，则用重复字符的位置去更新起始位置
def lengthOfLongestSubstring_0(s):
    st = {}
    i, ans = 0, 0
    for j in range(len(s)):
        if s[j] in st:
            i = max(st[s[j]], i)
        ans = max(ans, j - i + 1)
        st[s[j]] = j + 1
    #print(st)
    return ans 


